funcSearch:
function funcSearch() {
  const els = doc.gcn("ui-btn ui-btn-up-c ui-btn-corner-all ui-btn-icon-left");
  const dictCourse = {
    1: "In",
    2: "Out",
  };
  const result = [];
  Array.from(els).forEach((el) => {
    const param = el.getAttribute("for");
    if(!param) return;
    const date = "20" + param.gh(6);
    const time = param.ch(6).gh(4);
    const course = param.gt(1);
    console.log("reserve search", dictCourse[course], date, time);
    result.push({ date, time, course: dictCourse[course] });
  });
  const param = {
    golf_club_id: "26e86f63-ef9c-11ec-a93e-0242ac11000a",
    device_id: "${deviceId}",
    result,
  };
  const addr = OUTER_ADDR_HEADER + "/api/reservation/newReserveSearch";
  post(addr, param, { "Content-Type": "application/json" }, (data) => {
    log(data);
    funcEnd()
  });
}
